"languageName\":{\"simpleText\":\"Sinhala\"}},{\"languageCode\":\"sk\",\"languageName\":{\"simpleText\":\"Slovak\"}},{\"languageCode\":\"sl\",\"languageName\":{\"simpleText\":\"Slovenian\"}},{\"languageCode\":\"so\",\"languageName\":{\"simpleText\":\"Somali\"}},{\"languageCode\":\"st\",\"languageName\":{\"simpleText\":\"Southern Sotho\"}},{\"languageCode\":\"es\",\"languageName\":{\"simpleText\":\"Spanish\"}},{\"languageCode\":\"su\",\"languageName\":{\"simpleText\":\"Sundanese\"}},{\"languageCode\":\"sw\",\"languageName\":{\"simpleText\":\"Swahili\"}},{\"languageCode\":\"sv\",\"languageName\":{\"simpleText\":\"Swedish\"}},{\"languageCode\":\"tg\",\"languageName\":{\"simpleText\":\"Tajik\"}},{\"languageCode\":\"ta\",\"languageName\":{\"simpleText\":\"Tamil\"}},{\"languageCode\":\"tt\",\"languageName\":{\"simpleText\":\"Tatar\"}},{\"languageCode\":\"te\",\"languageName\":{\"simpleText\":\"Telugu\"}},{\"languageCode\":\"th\",\"languageName\":{\"simpleText\":\"Thai\"}},{\"languageCode\":\"tr\",\"languageName\":{\"simpleText\":\"Turkish\"}},{\"languageCode\":\"tk\",\"languageName\":{\"simpleText\":\"Turkmen\"}},{\"languageCode\":\"uk\",\"languageName\":{\"simpleText\":\"Ukrainian\"}},{\"languageCode\":\"ur\",\"languageName\":{\"simpleText\":\"Urdu\"}},{\"languageCode\":\"ug\",\"languageName\":{\"simpleText\":\"Uyghur\"}},{\"languageCode\":\"uz\",\"languageName\":{\"simpleText\":\"Uzbek\"}},{\"languageCode\":\"vi\",\"languageName\":{\"simpleText\":\"Vietnamese\"}},{\"languageCode\":\"cy\",\"languageName\":{\"simpleText\":\"Welsh\"}},{\"languageCode\":\"fy\",\"languageName\":{\"simpleText\":\"Western Frisian\"}},{\"languageCode\":\"xh\",\"languageName\":{\"simpleText\":\"Xhosa\"}},{\"languageCode\":\"yi\",\"languageName\":{\"simpleText\":\"Yiddish\"}},{\"languageCode\":\"yo\",\"languageName\":{\"simpleText\":\"Yoruba\"}},{\"languageCode\":\"zu\",\"languageName\":{\"simpleText\":\"Zulu\"}}],\"defaultAudioTrackIndex\":0}},\"videoDetails\":{\"videoId\":\"y6h8TIxeg1g\",\"title\":\"12 Autopsy Cases Reveal TRUTH About How Patients Die From Coronavirus | COVID-19\",\"lengthSeconds\":\"823\",\"keywords\":[\"coronavirus autopsy report\",\"coronavirus autopsy\",\"coronavirus autopsy report analysis\",\"covid-19 autopsy report\",\"covid-19 autopsy\",\"covid 19 virus\",\"#coronavirus\",\"#covid19\",\"#covid_19\",\"coronavirus\",\"covid-19\",\"covid 19\",\"coronavirus outbreak\",\"coronavirus outbreak 2020\",\"coronavirus truth\",\"coronavirus truth new york\",\"covid-19 autopsy report analysis\",\"coronavirus explained\",\"coronavirus explained doctor\",\"coronavirus usa patient\",\"autopsy\",\"autopsy report\",\"coronavirus update\",\"coronavirus usa\"],\"channelId\":\"UCMSsLqxqvZsNXi0Z-VjN89A\",\"isOwnerViewing\":false,\"shortDescription\":\"This is the link to the main study in this video:\\nhttps:\/\/www.acpjournals.org\/doi\/10.7326\/M20-2003\\n\\n12 Autopsy Cases Reveal TRUTH About How Patients Die From Coronavirus | COVID-19\\n#coronavirus #covid19 #covid_19\\n\\nCoronavirus | COVID-19 YouTube Video Playlist: \\nhttps:\/\/www.youtube.com\/playlist?list=PLgqCliyXQhezro4JBt2zJDWo7XdCTn_45\\n\\nThe vitamin D that I take: https:\/\/amzn.to\/36u3F0R\\n\\nIn all 12 cases, the cause of death was found within the lungs or the pulmonary vascular system. For the ones who did not die of large pulmonary emboli, they died of the extensive inflammation within the lungs, meaning pneumonia with ARDS. In these cases, the lungs were wet and heavy, much like a sponge that is saturated with water. The surfaces of the lung often had a distinct patchy pattern, with pale areas alternating with slightly protruding and firm, deep reddish-blue hypercapillarized areas. This is indicative of areas of intense inflammation, with endothelial dysfunction that can be seen at the microscopic level. When they look at slices of the lungs under the microscope, they found diffuse alveolar damage in 8 cases. Specifically, they saw hyaline membrane formation, and tiny clots in the capillaries, and capillaries that were engorged with red blood cells, and other inflammatory findings. All these findings represent ARDS. They also found lymphocytes, a type of white blood cell, infiltrated these areas of infiltration.  This fits the picture of viral pathogenesis.\\n\\nThey also looked at the pharynx of these patients, meaning in their throat. The lining of the throat, or mucosa, was hyperemic, meaning very red and irritated, and at the microscopic level, they saw lymphocytes invading there, which is consistent with a viral infection. In one case, a patient had lymphocytes invade his heart muscle, findings that are consistent with what we call viral myocarditis. More than half of the patients in this study had large blood clots. One-third of the patients had pulmonary embolism as the direct cause of death. All the others died of intense inflammation in their lungs related to pneumonia with ARDS (Acute Respiratory Distress Syndrome). Recently theres been studies showing that about 1\/3rd of patients with severe COVID have blood clots. Another study of 191 patients with coronavirus aka COVID-19, half of those who died had clots, compared with 7% of survivors. And levels of D-dimer that were greater than 1000 g\/L were associated with a fatal outcome. So it's pretty clear now that the SARS-CoV-2 virus is causing a lot of clots to form in moderate to severe COVID disease.\\n\\nHow is this happening? It's likely a combination of reasons, that has to do with downregulation of the ACE2 receptor in the lung alveoli, with a subsequent shift towards having more angiotensin II in the lungs, and less angiotensin 1-7 and 1-9 in the lungs, and when this happens, this leads to more cytokine storm with more inflammation, more constriction of pulmonary arteries, and more clots that develop. That, in turn, leads to more endothelial dysfunction in the capillaries that surround the alveoli. Also, there is evidence that the virus attaches to the ACE2 receptors of those endothelial cells that line those capillaries, which further propagates inflammation and clotting. And in the cytokine storm that develops there, RANTES, a chemokine, binds to the CCR5 receptor of CD4 and CD8 lymphocytes, and that causes those lymphocytes to infiltrate those areas of inflammation, and in doing so, further contributes towards the inflammatory reaction. This is why we are seeing low levels of CD4 and CD8 lymphocytes in severe COVID. Endothelial damage can also lead to the development of antiphospholipid antibodies, and these antibodies are bad because they trigger the formation of blood clots. Thats why patients who have clots with the diagnosis of antiphospholipid antibody syndrome need to be on blood thinners. \\n\\nAlso, 11 out of the 12 patients in this study had underlying heart disease and were obese. These are known risk factors not just for cardiovascular disease, but also known risk factors for endothelial dysfunction, and are known risk factors for COVID.  So the big takeaways from the findings in this study are that most people who die of COVID, it's primarily a lung problem. Either related to inflammation with ARDS and\/or blood clots.\\n\\nAntiphospholipid syndrome might be a commonality among patients with thrombosis in COVID-19 patients.\\n\\nDr. Mike Hansen, MD\\nInternal Medicine | Pulmonary Disease | Critical Care Medicine\\nWebsite: https:\/\/doctormikehansen.com\/\\nInstagram Account: http:\/\/instagram.com\/doctor.hansen\/\\n\\n#coronavirus #covid19 #covid_19\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/y6h8TIxeg1g\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDjB9FDV5KuuAtiUqaTIz_xox2tVg\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/y6h8TIxeg1g\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDpvKb2KjjsZjnxOrxlvr42snGznQ\",\"width\":196,\"height\":110},{\"url\":\"https:\ ents Die From Coronavirus | COVID-19\\n#coronavirus #covid19 #covid_19\\n\\nCoronavirus | COVID-19 YouTube Video Playlist: \\nhttps:\/\/www.youtube.com\/playlist?list=PLgqCliyXQhezro4JBt2zJDWo7XdCTn_45\\n\\nThe vitamin D that I take: https:\/\/amzn.to\/36u3F0R\\n\\nIn all 12 cases, the cause of death was found within the lungs or the pulmonary vascular system. For the ones who did not die of large pulmonary emboli, they died of the extensive inflammation within the lungs, meaning pneumonia with ARDS. In these cases, the lungs were wet and heavy, much like a sponge that is saturated with water. The surfaces of the lung often had a distinct patchy pattern, with pale areas alternating with slightly protruding and firm, deep reddish-blue hypercapillarized areas. This is indicative of areas of intense inflammation, with endothelial dysfunction that can be seen at the microscopic level. When they look at slices of the lungs under the microscope, they found diffuse alveolar damage in 8 cases. Specifically, they saw hyaline membrane formation, and tiny clots in the capillaries, and capillaries that were engorged with red blood cells, and other inflammatory findings. All these findings represent ARDS. They also found lymphocytes, a type of white blood cell, infiltrated these areas of infiltration.  This fits the picture of viral pathogenesis.\\n\\nThey also looked at the pharynx of these patients, meaning in their throat. The lining of the throat, or mucosa, was hyperemic, meaning very red and irritated, and at the microscopic level, they saw lymphocytes invading there, which is consistent with a viral infection. In one case, a patient had lymphocytes invade his heart muscle, findings that are consistent with what we call viral myocarditis. More than half of the patients in this study had large blood clots. One-third of the patients had pulmonary embolism as the direct cause of death. All the others died of intense inflammation in their lungs related to pneumonia with ARDS (Acute Respiratory Distress Syndrome). Recently theres been studies showing that about 1\/3rd of patients with severe COVID have blood clots. Another study of 191 patients with coronavirus aka COVID-19, half of those who died had clots, compared with 7% of survivors. And levels of D-dimer that were greater than 1000 g\/L were associated with a fatal outcome. So it's pretty clear now that the SARS-CoV-2 virus is causing a lot of clots to form in moderate to severe COVID disease.\\n\\nHow is this happening? It's likely a combination of reasons, that has to do with downregulation of the ACE2 receptor in the lung alveoli, with a subsequent shift towards having more angiotensin II in the lungs, and less angiotensin 1-7 and 1-9 in the lungs, and when this happens, this leads to more cytokine storm with more inflammation, more constriction of pulmonary arteries, and more clots that develop. That, in turn, leads to more endothelial dysfunction in the capillaries that surround the alveoli. Also, there is evidence that the virus attaches to the ACE2 receptors of those endothelial cells that line those capillaries, which further propagates inflammation and clotting. And in the cytokine storm that develops there, RANTES, a chemokine, binds to the CCR5 receptor of CD4 and CD8 lymphocytes, and that causes those lymphocytes to infiltrate those areas of inflammation, and in doing so, further contributes towards the inflammatory reaction. This is why we are seeing low levels of CD4 and CD8 lymphocytes in severe COVID. Endothelial damage can also lead to the development of antiphospholipid antibodies, and these antibodies are bad because they trigger the formation of blood clots. Thats why patients who have clots with the diagnosis of antiphospholipid antibody syndrome need to be on blood thinners. \\n\\nAlso, 11 out of the 12 patients in this study had underlying heart disease and were obese. These are known risk factors not just for cardiovascular disease, but also known risk factor a":{"url":"/redirect?redir_token=y-3YWKoXjilwj7qqv78qI5cbw4F8MTU5MzE3MjUwNEAxNTkzMDg2MTA0\u0026v=y6h8TIxeg1g\u0026q=https%3A%2F%2Fwww.acpjournals.org%2Fdoi%2F10.7326%2FM20-2003\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?redir_token=y-3YWKoXjilwj7qqv78qI5cbw4F8MTU5MzE3MjUwNEAxNTkzMDg2MTA0\u0026v=y6h8TIxeg1g\u0026q=https%3A%2F%2Fwww.acpjournals.org%2Fdoi%2F10.7326%2FM20-2003\u0026event=video_description","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\n12 Autopsy Cases Reveal TRUTH About How Patients Die From Coronavirus | COVID-19\n"},{"text":"#coronavirus","navigationEndpoint":{"clickTrackingParams":"CJoBENzXBCITCLWX-pr0nOoCFYfKtAod2B8MoA==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23coronavirus","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#coronavirus"}},"loggingDirectives":{"trackingParams":"CJoBENzXBCITCLWX-pr0nOoCFYfKtAod2B8MoA==","visibility":{"types":"12"}}},{"text":" "},{"text":"#covid19","navigationEndpoint":{"clickTrackingParams":"CJkBENzXBCITCLWX-pr0nOoCFYfKtAod2B8MoA==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23covid19","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#covid19"}},"loggingDirectives":{"trackingParams":"CJkBENzXBCITCLWX-pr0nOoCFYfKtAod2B8MoA==","visibility":{"types":"12"}}},{"text":" "},{"text":"#covid_19","navigationEndpoint":{"clickTrackingParams":"CJgBENzXBCITCLWX-pr0nOoCFYfKtAod2B8MoA==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23covid_19","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#covid_19"}},"loggingDirectives":{"trackingParams":"CJgBENzXBCITCLWX-pr0nOoCFYfKtAod2B8MoA==","visibility":{"types":"12"}}},{"text":"\n\nCoronavirus | COVID-19 YouTube Video Playlist: \n"},{"text":"https://www.youtube.com/playlist?list...","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgCIhMItZf6mvSc6gIVh8q0Ch3YHwygSNiG-uLIiZ_UywE=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/playlist?list=PLgqCliyXQhezro4JBt2zJDWo7XdCTn_45","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/playlist?list=PLgqCliyXQhezro4JBt2zJDWo7XdCTn_45","nofollow":true}}},{"text":"\n\nThe vitamin D that I take: "},{"text":"https://amzn.to/36u3F0R","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgCIhMItZf6mvSc6gIVh8q0Ch3YHwygSNiG-uLIiZ_UywE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?redir_token=y-3YWKoXjilwj7qqv78qI5cbw4F8MTU5MzE3MjUwNEAxNTkzMDg2MTA0\u0026v=y6h8TIxeg1g\u0026q=https%3A%2F%2Famzn.to%2F36u3F0R\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?redir_token=y-3YWKoXjilwj7qqv78qI5cbw4F8MTU5MzE3MjUwNEAxNTkzMDg2MTA0\u0026v=y6h8TIxeg1g\u0026q=https%3A%2F%2Famzn.to%2F36u3F0R\u0026event=video_description","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nIn all 12 cases, the cause of death was found within the lungs or the pulmonary vascular system. For the ones who did not die of large pulmonary emboli, they died of the extensive inflammation within the lungs, meaning pneumonia with ARDS. In these cases, the lungs were wet and heavy, much like a sponge that is saturated with water. The surfaces of the lung often had a distinct patchy pattern, with pale areas alternating with slightly protruding and firm, deep reddish-blue hypercapillarized areas. This is indicative of areas of intense inflammation, with endothelial dysfunction that can be seen at the microscopic level. When they look at slices of the lungs under the microscope, they found diffuse alveolar damage in 8 cases. Specifically, they saw hyaline membrane formation, and tiny clots in the capillaries, and capillaries that were engorged with red blood cells, and other inflammatory findings. All these findings represent ARDS. They also found lymphocytes, a type of white blood cell, infiltrated these areas of infiltration.  This fits the picture of viral pathogenesis.\n\nThey also looked at the pharynx of these patients, meaning in their throat. The lining of the throat, or mucosa, was hyperemic, meaning very red and irritated, and at the microscopic level, they saw lymphocytes invading there, which is consistent with a viral infection. In one case, a patient had lymphocytes invade his heart muscle, findings that are consistent with what we call viral myocarditis. More than half of the patients in this study had large blood clots. One-third of the patients had pulmonary embolism as the direct cause of death. All the others died of intense inflammation in their lungs related to pneumonia with ARDS (Acute Respiratory Distress Syndrome). Recently theres been studies showing that about 1/3rd of patients with severe COVID have blood clots. Another study of 191 patients with coronavirus aka COVID-19, half of those who died had clots, compared with 7% of survivors. And levels of D-dimer that were greater than 1000 g/L were associated with a fatal outcome. So it's pretty clear now that the SARS-CoV-2 virus is causing a lot of clots to form in moderate to severe COVID disease.\n\nHow is this happening? It's likely a combination of reasons, that has to do with downregulation of the ACE2 receptor in the lung alveoli, with a subsequent shift towards having more angiotensin II in the lungs, and less angiotensin 1-7 and 1-9 in the lungs, and when this happens, this leads to more cytokine storm with more inflammation, more constriction of pulmonary arteries, and more clots that develop. That, in turn, leads to more endothelial dysfunction in the capillaries that surround the alveoli. Also, there is evidence that the virus attaches to the ACE2 receptors of those endothelial cells that line those capillaries, which further propagates inflammation and clotting. And in the cytokine storm that develops there, RANTES, a chemokine, binds to the CCR5 receptor of CD4 and CD8 lymphocytes, and that causes those lymphocytes to infiltrate those areas of inflammation, and in doing so, further contributes towards the inflammatory reaction. This is why we are seeing low levels of CD4 and CD8 lymphocytes in severe COVID. Endothelial damage can also lead to the development of antiphospholipid antibodies, and these antibodies are bad because they trigger the formation of blood clots. Thats why patients who have clots with the diagnosis of antiphospholipid antibody syndrome need to be on blood thinners. \n\nAlso, 11 out of the 12 patients in this study had underlying heart disease and were obese. These are known risk factors not just for cardiovascular disease, but also known risk factors for endothelial dysfunction, and are known risk factors for COVID.  So the big takeaways from the findings in this study are that most people who die of COVID, it's primarily a lung problem. Either related to inflammation with ARDS and/or blood clots.\n\nAntiphospholipid syndrome might be a commonality among patients with thrombosis in COVID-19 patients.\n\nDr. Mike Hansen, MD\nInternal Medicine | Pulmonary Disease | Critical Care Medicine\nWebsite: "},{"text":"https://doctormikehansen.com/","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgCIhMItZf6mvSc6gIVh8q0Ch3YHwygSNiG-uLIiZ_UywE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?redir_token=y-3YWKoXjilwj7qqv78qI5cbw4F8MTU5MzE3MjUwNEAxNTkzMDg2MTA0\u0026v=y6h8TIxeg1g\u0026q=https%3A%2F%2Fdoctormikehansen.com%2F\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?redir_token=y-3YWKoXjilwj7qqv78qI5cbw4F8MTU5MzE3MjUwNEAxNTkzMDg2MTA0\u0026v=y6h8TIxeg1g\u0026q=https%3A%2F%2Fdoctormikehansen.com%2F\u0026event=video_description","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\nInstagram Account: "},{"text":"http://instagram.com/doctor.hansen/","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgCIhMItZf6mvSc6gIVh8q0Ch3YHwygSNiG-uLIiZ_UywE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?redir_token=y- ,"languageName":{"simpleText":"Spanish"}},{"languageCode":"su","languageName":{"simpleText":"Sundanese"}},{"languageCode":"sw","languageName":{"simpleText":"Swahili"}},{"languageCode":"sv","languageName":{"simpleText":"Swedish"}},{"languageCode":"tg","languageName":{"simpleText":"Tajik"}},{"languageCode":"ta","languageName":{"simpleText":"Tamil"}},{"languageCode":"tt","languageName":{"simpleText":"Tatar"}},{"languageCode":"te","languageName":{"simpleText":"Telugu"}},{"languageCode":"th","languageName":{"simpleText":"Thai"}},{"languageCode":"tr","languageName":{"simpleText":"Turkish"}},{"languageCode":"tk","languageName":{"simpleText":"Turkmen"}},{"languageCode":"uk","languageName":{"simpleText":"Ukrainian"}},{"languageCode":"ur","languageName":{"simpleText":"Urdu"}},{"languageCode":"ug","languageName":{"simpleText":"Uyghur"}},{"languageCode":"uz","languageName":{"simpleText":"Uzbek"}},{"languageCode":"vi","languageName":{"simpleText":"Vietnamese"}},{"languageCode":"cy","languageName":{"simpleText":"Welsh"}},{"languageCode":"fy","languageName":{"simpleText":"Western Frisian"}},{"languageCode":"xh","languageName":{"simpleText":"Xhosa"}},{"languageCode":"yi","languageName":{"simpleText":"Yiddish"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"y6h8TIxeg1g","title":"12 Autopsy Cases Reveal TRUTH About How Patients Die From Coronavirus | COVID-19","lengthSeconds":"823","keywords":["coronavirus autopsy report","coronavirus autopsy","coronavirus autopsy report analysis","covid-19 autopsy report","covid-19 autopsy","covid 19 virus","#coronavirus","#covid19","#covid_19","coronavirus","covid-19","covid 19","coronavirus outbreak","coronavirus outbreak 2020","coronavirus truth","coronavirus truth new york","covid-19 autopsy report analysis","coronavirus explained","coronavirus explained doctor","coronavirus usa patient","autopsy","autopsy report","coronavirus update","coronavirus usa"],"channelId":"UCMSsLqxqvZsNXi0Z-VjN89A","isOwnerViewing":false,"shortDescription":"This is the link to the main study in this video:\nhttps://www.acpjournals.org/doi/10.7326/M20-2003\n\n12 Autopsy Cases Reveal TRUTH About How Patients Die From Coronavirus | COVID-19\n#coronavirus #covid19 #covid_19\n\nCoronavirus | COVID-19 YouTube Video Playlist: \nhttps://www.youtube.com/playlist?list=PLgqCliyXQhezro4JBt2zJDWo7XdCTn_45\n\nThe vitamin D that I take: https://amzn.to/36u3F0R\n\nIn all 12 cases, the cause of death was found within the lungs or the pulmonary vascular system. For the ones who did not die of large pulmonary emboli, they died of the extensive inflammation within the lungs, meaning pneumonia with ARDS. In these cases, the lungs were wet and heavy, much like a sponge that is saturated with water. The surfaces of the lung often had a distinct patchy pattern, with pale areas alternating with slightly protruding and firm, deep reddish-blue hypercapillarized areas. This is indicative of areas of intense inflammation, with endothelial dysfunction that can be seen at the microscopic level. When they look at slices of the lungs under the microscope, they found diffuse alveolar damage in 8 cases. Specifically, they saw hyaline membrane formation, and tiny clots in the capillaries, and capillaries that were engorged with red blood cells, and other inflammatory findings. All these findings represent ARDS. They also found lymphocytes, a type of white blood cell, infiltrated these areas of infiltration.  This fits the picture of viral pathogenesis.\n\nThey also looked at the pharynx of these patients, meaning in their throat. The lining of the throat, or mucosa, was hyperemic, meaning very red and irritated, and at the microscopic level, they saw lymphocytes invading there, which is consistent with a viral infection. In one case, a patient had lymphocytes invade his heart muscle, findings that are consistent with what we call viral myocarditis. More than half of the patients in this study had large blood clots. One-third of the patients had pulmonary embolism as the direct cause of death. All the others died of intense inflammation in their lungs related to pneumonia with ARDS (Acute Respiratory Distress Syndrome). Recently theres been studies showing that about 1/3rd of patients with severe COVID have blood clots. Another study of 191 patients with coronavirus aka COVID-19, half of those who died had clots, compared with 7% of survivors. And levels of D-dimer that were greater than 1000 g/L were associated with a fatal outcome. So it's pretty clear now that the SARS-CoV-2 virus is causing a lot of clots to form in moderate to severe COVID disease.\n\nHow is this happening? It's likely a combination of reasons, that has to do with downregulation of the ACE2 receptor in the lung alveoli, with a subsequent shift towards having more angiotensin II in the lungs, and less angiotensin 1-7 and 1-9 in the lungs, and when this happens, this leads to more cytokine storm with more inflammation, more constriction of pulmonary arteries, and more clots that develop. That, in turn, leads to more endothelial dysfunction in the capillaries that surround the alveoli. Also, there is evidence that the virus attaches to the ACE2 receptors of those endothelial cells that line those capillaries, which further propagates inflammation and clotting. And in the cytokine storm that develops there, RANTES, a chemokine, binds to the CCR5 receptor of CD4 and CD8 lymphocytes, and that causes those lymphocytes to infiltrate those areas of inflammation, and in doing so, further contributes towards the inflammatory reaction. This is why we are seeing low levels of CD4 and CD8 lymphocytes in severe COVID. Endothelial damage can also lead to the development of antiphospholipid antibodies, and these antibodies are bad because they trigger the formation of blood clots. Thats why patients who have clots with the diagnosis of antiphospholipid antibody syndrome need to be on blood thinners. \n\nAlso, 11 out of the 12 patients in this study had underlying heart disease and were obese. These are known risk factors not just for cardiovascular disease, but also known risk factors for endothelial dysfunction, and are known risk factors for COVID.  So the big takeaways from the findings in this study are that most people who die of COVID, it's primarily a lung problem. Either related to inflammation with ARDS and/or blood clots.\n\nAntiphospholipid syndrome might be a commonality among patients with thrombosis in COVID-19 patients.\n\nDr. Mike Hansen, MD\nInternal Medicine | Pulmonary Disease | Critical Care Medicine\nWebsite: https://doctormikehansen.com/\nInstagram Account: http://instagram.com/doctor.hansen/\n\n#coronavirus #covid19 #covid_19","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/y6h8TIxeg1g/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDjB9FDV5KuuAtiUqaTIz_xox2tVg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/y6h8TIxeg1g/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDpvKb2KjjsZjnxOrxlvr42snGznQ","width":196,"height":110},{"url":"https://i.ytimg.com/vi/y6h8TIxeg1g/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLCWFEmir9Q87Q3-C9xyCFMdTC8IgQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/y6h8TIxeg1g/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDprvbO9IWDnFxtBb_e2KrgNRC2JQ","width":336,"height":188},{"url":"https://i.ytimg.com/vi/y6h8TIxeg1g/maxresdefault.jpg","width":1920,"height":1080}]},"useCipher":false,"averageRating":4.8656831,"allowRatings":true,"viewCount":"2550102","author":"Doctor Mike Hansen","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"0","endTimeMs":"80 rABFbABHLABKbABLrABObABR7ABTbABP7ABJbABLrABN7ABPbABR7ABUrABUbABRbABM7ABQLABQrABQ7ABTLABRLABRrABQ7gBEbgBEbgBFbgBI7gBRLgBQ7gBQ7gBQ7gBEbgBE7gBFrgBL7gBQ7gBQ7gBQ7gBQ7gBFbgBFrgBKbgBQ7gBQ7gBQ7gBQ7gBQ7gBI7gBL7gBQ7gBQ7gBQ7gBQ7gBQ7gBQ7gBRLgBQ7gBQ7gBQ7gBQ7gBQ7gBQrgBQrgBQ7gBQ7gBQ7gBQ7gBQ7gBQrgBQrgBQrgBQ7gBQ7gBQ7gBQ7gBQrgBQrgBQrgBQrgBQ7gBQ7gBQ7gBQrgBQrgBQrgBQrgBQqLzl_8DBgixwPX1BQ==|48#27#100#10#10#0#default#rs$AOn4CLA2kfoXWf_MYCYbXoa9ukYptOJnaQ|80#45#166#10#10#5000#M$M#rs$AOn4CLCC_IRnogmElDVHB9IAYqXRaNC52A|160#90#166#5#5#5000#M$M#rs$AOn4CLAfYf5-R7tyP8C5PQeS6drgZ4hTuQ"}},"microformat":{"playerMicroformatRenderer":{"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/y6h8TIxeg1g/maxresdefault.jpg","width":1280,"height":720}]},"embed":{"iframeUrl":"https://www.youtube.com/embed/y6h8TIxeg1g","flashUrl":"http://www.youtube.com/v/y6h8TIxeg1g?version=3\u0026autohide=1","width":1280,"height":720,"flashSecureUrl":"https://www.youtube.com/v/y6h8TIxeg1g?version=3\u0026autohide=1"},"title":{"simpleText":"12 Autopsy Cases Reveal TRUTH About How Patients Die From Coronavirus | COVID-19"},"description":{"simpleText":"This is the link to the main study in this video:\nhttps://www.acpjournals.org/doi/10.7326/M20-2003\n\n12 Autopsy Cases Reveal TRUTH About How Patients Die From Coronavirus | COVID-19\n#coronavirus #covid19 #covid_19\n\nCoronavirus | COVID-19 YouTube Video Playlist: \nhttps://www.youtube.com/playlist?list=PLgqCliyXQhezro4JBt2zJDWo7XdCTn_45\n\nThe vitamin D that I take: https://amzn.to/36u3F0R\n\nIn all 12 cases, the cause of death was found within the lungs or the pulmonary vascular system. For the ones who did not die of large pulmonary emboli, they died of the extensive inflammation within the lungs, meaning pneumonia with ARDS. In these cases, the lungs were wet and heavy, much like a sponge that is saturated with water. The surfaces of the lung often had a distinct patchy pattern, with pale areas alternating with slightly protruding and firm, deep reddish-blue hypercapillarized areas. This is indicative of areas of intense inflammation, with endothelial dysfunction that can be seen at the microscopic level. When they look at slices of the lungs under the microscope, they found diffuse alveolar damage in 8 cases. Specifically, they saw hyaline membrane formation, and tiny clots in the capillaries, and capillaries that were engorged with red blood cells, and other inflammatory findings. All these findings represent ARDS. They also found lymphocytes, a type of white blood cell, infiltrated these areas of infiltration.  This fits the picture of viral pathogenesis.\n\nThey also looked at the pharynx of these patients, meaning in their throat. The lining of the throat, or mucosa, was hyperemic, meaning very red and irritated, and at the microscopic level, they saw lymphocytes invading there, which is consistent with a viral infection. In one case, a patient had lymphocytes invade his heart muscle, findings that are consistent with what we call viral myocarditis. More than half of the patients in this study had large blood clots. One-third of the patients had pulmonary embolism as the direct cause of death. All the others died of intense inflammation in their lungs related to pneumonia with ARDS (Acute Respiratory Distress Syndrome). Recently theres been studies showing that about 1/3rd of patients with severe COVID have blood clots. Another study of 191 patients with coronavirus aka COVID-19, half of those who died had clots, compared with 7% of survivors. And levels of D-dimer that were greater than 1000 g/L were associated with a fatal outcome. So it's pretty clear now that the SARS-CoV-2 virus is causing a lot of clots to form in moderate to severe COVID disease.\n\nHow is this happening? It's likely a combination of reasons, that has to do with downregulation of the ACE2 receptor in the lung alveoli, with a subsequent shift towards having more angiotensin II in the lungs, and less angiotensin 1-7 and 1-9 in the lungs, and when this happens, this leads to more cytokine storm with more inflammation, more constriction of pulmonary arteries, and more clots that develop. That, in turn, leads to more endothelial dysfunction in the capillaries that surround the alveoli. Also, there is evidence that the virus attaches to the ACE2 receptors of those endothelial cells that line those capillaries, which further propagates inflammation and clotting. And in the cytokine storm that develops there, RANTES, a chemokine, binds to the CCR5 receptor of CD4 and CD8 lymphocytes, and that causes those lymphocytes to infiltrate those areas of inflammation, and in doing so, further contributes towards the inflammatory reaction. This is why we are seeing low levels of CD4 and CD8 lymphocytes in severe COVID. Endothelial damage can also lead to the development of antiphospholipid antibodies, and these antibodies are bad because they trigger the formation of blood clots. Thats why patients who have clots with the diagnosis of antiphospholipid antibody syndrome need to be on blood thinners. \n\nAlso, 11 out of the 12 patients in this study had underlying heart disease and were obese. These are known risk factors not just for cardiovascular disease, but also known risk factors for endothelial dysfunction, and are known risk factors for COVID.  So the big takeaways from the findings in this study are that most people who die of COVID, it's primarily a lung problem. Either related to inflammation with ARDS and/or blood clots.\n\nAntiphospholipid syndrome might be a commonality among patients with thrombosis in COVID-19 patients.\n\nDr. Mike Hansen, MD\nInternal Medicine | Pulmonary Disease | Critical Care Medicine\nWebsite: https://doctormikehansen.com/\nInstagram Account: http://instagram.com/doctor.hansen/\n\n#coronavirus #covid19 #covid_19"},"lengthSeconds":"823","ownerProfileUrl":"http://www.youtube.com/channel/UCMSsLqxqvZsNXi0Z-VjN89A","externalChannelId":"UCMSsLqxqvZsNXi0Z-VjN89A","isFamilySafe":true,"availableCountries
